/* nimble light */
/* nimble light */
atom-text-editor,
:host {
  background-color: #c0e4d5;
  color: #3d6680;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #b2decb;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #b2decb;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #ddf0e8;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #c0e4d5;
  color: #8acdb1;
  border-right: 1px solid #b2decb;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #cbe9dc;
  color: rgba(248, 124, 92, 0.6);
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: rgba(248, 124, 92, 0.6);
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #75c4a3;
}
atom-text-editor .invisible,
:host .invisible {
  color: #3d6680;
}
atom-text-editor .cursor,
:host .cursor {
  color: #ffffff;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: rgba(251, 183, 165, 0.6);
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid rgba(247, 105, 67, 0.3);
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #79c5a5;
}
atom-text-editor::shadow .bracket-matcher .region {
  border-radius: 2px;
  border: 1px solid #8acdb1;
}
.source.coffee .storage.function {
  color: #df536d;
}
.source.coffee .string.quoted.double .embedded,
.source.coffee .string.quoted.double .embedded.punctuation {
  color: #007756;
}
.source.coffee .variable.instance,
.source.coffee .variable.instance .punctuation.definition {
  color: #851f75;
}
.source.css.less .variable,
.source.css.sass .variable,
.source.css.scss .variable {
  color: #aa2896;
}
.source.css .entity,
.source.css .html.elements {
  color: #0095aa;
}
.source.css .entity.punctuation.definition,
.source.css .html.elements.punctuation.definition {
  color: #df536d;
}
.source.css .punctuation.definition.constant {
  color: #007756;
}
.source.css .constant.other.color,
.source.css .constant.other.rgb-value {
  color: #00aa7b;
}
.source.css .constant.other.color.scss .punctuation.definition,
.source.css .constant.other.rgb-value.scss .punctuation.definition {
  color: #007756;
}
.source.css.scss .punctuation {
  color: #3d6680;
}
.source.css.scss .entity.tag {
  color: #00aa7b;
}
.source.gfm .markup.heading.heading-1 {
  color: #df536d;
}
.source.gfm .markup.heading.heading-2 {
  color: #df5356;
}
.source.gfm .markup.heading.heading-3 {
  color: #df6853;
}
.source.gfm .markup.heading.heading-4 {
  color: #df7f53;
}
.source.gfm .markup.heading.heading-5 {
  color: #df9653;
}
.source.gfm .markup.heading.heading-6 {
  color: #dfae53;
}
.source.gfm .link {
  color: #0095aa;
}
.source.gfm .list {
  color: #df536d;
}
.source.gfm .support {
  background: rgba(0, 149, 170, 0.6);
  color: #3d6680;
  border-radius: 3px;
}
.source.gfm .quote {
  color: #3d6680;
}
.source.gfm .quote .support {
  color: #3d6680;
  border-radius: 0;
}
.source.gfm .table .border.pipe,
.source.gfm .table .border.header {
  color: #aa2896;
}
.source.gfm .table .border.alignment {
  color: #0095aa;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.link {
  color: #c56d7d;
}
.source.gfm .markup.bold {
  color: #3d6680;
  font-weight: bold;
}
.source.gfm .markup.italic {
  color: #3d6680;
  font-style: italic;
}
.source.gfm .markup.strike {
  text-decoration: line-through;
}
.source.gfm .markup.raw {
  background: rgba(255, 255, 255, 0.35);
  border: 1px solid #8acdb1;
  border-radius: 6px;
}
.entity.name.tag {
  color: #aa2896;
}
.entity.name.tag .string {
  color: #00aa7b;
}
.punctuation.definition.tag {
  color: #aa2896;
}
.sgml .punctuation.definition.tag {
  color: #3d6680;
}
.source.js .string.template .embedded {
  color: #007756;
}
.source.js .keyword.control,
.source.js .variable.default {
  color: #df536d;
}
.source.json .meta.structure.dictionary .string {
  color: #00aa7b;
}
.source.json .meta.structure.dictionary .punctuation.definition {
  color: #007756;
}
.source.json .meta.structure.dictionary .punctuation.definition.dictionary,
.source.json .meta.structure.dictionary .punctuation.definition.array {
  color: #3d6680;
}
.source.json .meta.structure.dictionary .dictionary.value .string {
  color: #0095aa;
}
.source.json .meta.structure.dictionary .dictionary.value .string .punctuation.definition {
  color: #007a8b;
}
.source.json .meta.structure.dictionary .dictionary.value .dictionary .string {
  color: #00aa7b;
}
.source.json .meta.structure.dictionary .dictionary.value .dictionary .string .punctuation.definition {
  color: #007756;
}
.source.json .meta.structure.dictionary .dictionary.value .dictionary .dictionary.value .string {
  color: #0095aa;
}
.source.ruby .string.double.quoted .embedded {
  color: #007756;
}
.source.ruby .punctuation.separator.variable,
.source.ruby .variable.block {
  color: #df536d;
}
.source.ruby .variable.instance {
  color: #007a8b;
}
.source.ruby .variable.instance .punctuation.definition {
  color: #0095aa;
}
.source.ruby .punctuation.inheritance {
  color: #c56d7d;
}
.source.ruby .constant.symbol {
  color: #00aa7b;
}
.source.ruby .constant.symbol .punctuation.definition {
  color: #007756;
}
.keyword {
  color: #aa2896;
}
.keyword.regexp {
  color: #df536d;
}
.keyword.operator {
  color: #3d6680;
}
.keyword.operator.regexp {
  color: #df536d;
}
.keyword.other.unit {
  color: #007a8b;
}
.storage {
  color: #aa2896;
}
.string {
  color: #00aa7b;
}
.comment {
  color: #8acdb1;
  font-style: italic;
}
.constant {
  color: #3d6680;
}
.constant.character.escape,
.constant.numeric {
  color: #0095aa;
}
.constant.boolean {
  color: #df536d;
}
.entity.name.function {
  color: #0095aa;
}
.variable {
  color: #3d6680;
}
.variable.parameter {
  color: #007a8b;
}
.punctuation.definition.comment {
  color: #8acdb1;
}
.punctuation.definition.parameters {
  color: #007a8b;
}
.punctuation.definition.string,
.punctuation.definition.array {
  color: #00aa7b;
}
.invalid.illegal {
  background-color: #df536d;
  color: #c0e4d5;
}
